// Navbar Component -- Top of page
import { Navbar } from 'react-bootstrap';
// React Router
import { NavLink } from 'react-router-dom';
// Images for navigation
import ETH from '../../img/nav/eth.png';
import BTC from '../../img/nav/btc.png';
import BNB from '../../img/nav/bnb.png';

const Navi = () => {
    return (
        <div className="Navi">
            <Navbar expand="lg">
                <NavbarCollapse className="justify-content-center">
                        <div className="NavItem"> 
                            <NavLink exact to="/elections"> 
                                <Button variant="custom" size="lg"> Elections </Button>
                            </NavLink>
                        </div>
                        <div className="NavItem"> 
                            <NavLink exact to="/motor-vehicle"> 
                                <Button variant="custom" size="lg"> Motor Vehicle </Button>
                            </NavLink>
                        </div>
                        <div className="NavItem"> 
                            <NavLink exact to="/recording"> 
                                <Button variant="custom" size="lg"> Recording </Button>
                            </NavLink>
                        </div>
                        <div className="NavItem"> 
                            <NavLink exact to="/clerk-to-the-board"> 
                                <Button variant="custom last" size="lg"> Clerk to the Board </Button>
                            </NavLink>
                        </div>
                    </NavbarCollapse>
            </Navbar>
        </div>
    );  
}

export default Navi;
